import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import MainScreen from './screens/Mainscreen'
import AnimationScreen from './screens/Animationscreen'
import AlertScreen from './screens/Alertscreen'
import ProfileScreen from './screens/Profilescreen'

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Home" component={HomeScreen} options={{ title: 'Home' }}/>
        <Stack.Screen name="Profile" component={ProfileScreen} />
        <Stack.Screen name="Main" component={MainScreen} />
        <Stack.Screen name="Animation" component={AnimationScreen} />
        <Stack.Screen name="Alert" component={AlertScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}



const HomeScreen = ({ navigation }) => {
  return (
    <View>
        <View>
            <Button title="Go to Profile" onPress={() => navigation.navigate('Profile', { name: 'Jane' })}/>
            <View>
                <Text style={styles.homeTextMain}> This is Where you can leave your personal ToDO List </Text>
            </View>
        </View>
        <View>
            <Button title="Go to Main ML" onPress={() => navigation.navigate('Main', { name: 'Jane' })}/>
            <Text> This is where you could use Machine Learning  to test photo performance!</Text>
        </View>
        <View>
            <Button title="Go to Animation" onPress={() => navigation.navigate('Animation', { name: 'Jane' })}/>
            <Text> This is where you could use Test our Animation Screen!</Text>
        </View>
        <View>
            <Button title="Go to Alert" onPress={() => navigation.navigate('Alert', { name: 'Jane' })}/>
            <Text> This is where you could use Test our Alert Screen!</Text>
        </View>

    </View>
  );
};



const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  homeTextMain: {
    marginTop: 10,
    marginBottom: 10,
    alignItems: 'center',
    justifyContent: 'center',
    fontSize: 12,
  },


});
